import React from 'react';
import {
    MDBNavbar,
    MDBContainer,
    MDBNavbarBrand,
    MDBCol,
} from 'mdb-react-ui-kit';

export default function Navbar() {

    return (
        <>
            <MDBNavbar expand='lg' dark bgColor='dark'>
                <MDBCol >
                    <p >Game</p>

                </MDBCol>
            </MDBNavbar>
        </>
    );
}
